import React from 'react'

const Footer = () => {
  return (
    <footer>
        <h2>This is the footer</h2>
        <Pagination count={10} />
        <Pagination count={10} color="primary" />
        <Pagination count={10} color="secondary" />
        <Pagination count={10} disabled />
    </footer>
  )
}

export default Footer
